    /// <summary>
    /// Contains settings for checkmate tests. These are tests which check how quickly a given algorithm
    /// can identify the correct sequence of moves for a checkmate.
    /// </summary>
    class TestSettings
    {
        public struct Setting
        {
            /// <summary>
            /// A specification of the initial state of the chess board in the FEN notation.
            /// </summary>
            public readonly string fen;

            /// <summary>
            /// The shortest number of moves in which checkmate can be achieved.
            /// </summary>
            public readonly int numOfMoves;

            /// <summary>
            /// The team for which the given aglorithm will play.
            /// </summary>
            public readonly bool team;

            /// <summary>
            /// The list of possible correct solutions.
            /// </summary>
            public readonly List<Move> correctMoves;

            public Setting(string fen, int numOfMoves, bool team, List<Move> correctMoves)
            {
                this.fen = fen;
                this.numOfMoves = numOfMoves;
                this.team = team;
                this.correctMoves = correctMoves;
            }
        }

